from django.db import modelsfrom apps.account.models import Accountfrom apps.logus.models import TariffModel, TypeModelclass TariffTypePriceModel(models.Model):    tariff = models.ForeignKey(TariffModel, on_delete=models.CASCADE)    type = models.ForeignKey(TypeModel, on_delete=models.CASCADE)    price = models.IntegerField()    created_by = models.ForeignKey(Account, related_name="tariff_type_price", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_tariff_type_price", on_delete=models.SET_NULL,                                    null=True)    def __str__(self):        return f"{self.tariff} - {self.type} - {self.price}"